                <i className="bx bx-search"></i>
            </div>
             <div className="topnav__right">
                 <div className="topnav__right-item">
                      {/* dropdown here */}
                 </div>
                 <div className="topnav__right-item">
                      {/* dropdown here */}
                 </div>
                 <div className="topnav__right-item">
                      {/* theme setting */}
                 </div>
             </div>
        </div>
    )
}

export default Topnav
